module.exports = "<div class=\"roadmap-general\">\n  <div class=\"search-results-banner\">\n    <h1>Roadmap</h1>\n  </div>\n  <div class=\"usa-grid-full roadmap-overview\">\n    <h3>Overview</h3>\n    <p>At Code.gov, we know it’s important to keep an open dialogue with our users. That’s why we’re sharing our plans for the future through this Development Roadmap. Hopefully, it will help you better understand our priorities for the platform.</p>\n\n    <p>The Development Roadmap is organized into three categories – Near-term, Mid-term, and Long-term. Priorities are sorted into roadmap categories based on feedback we receive during user interviews. Dependencies and resources are also factors that affect placement on the roadmap. If you want to join the Code.gov user testing group, please email us at <a href=\"mailto:code@gsa.gov\">Code@gsa.gov</a>.</p>\n  </div>\n\n  <div class=\"usa-grid-full roadmap-table\">\n    <h3>Roadmap</h3>\n\n    <div class=\"usa-width-one-third\">\n      <table>\n        <thead>\n          <tr>\n            <th scope=\"col\" colspan=\"2\">Near-term</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <td class=\"fa-graphic-spacing\">\n              <ul>\n                <li><i class=\"fa fa-check\" aria-hidden=\"true\"></i></li>\n                <li>&nbsp;</li>\n                <li><i class=\"fa fa-circle\" aria-hidden=\"true\"></i></li>\n                <li><i class=\"fa fa-check\" aria-hidden=\"true\"></i></li>\n                <li><i class=\"fa fa-circle\" aria-hidden=\"true\"></i></li>\n                <li><i class=\"fa fa-check\" aria-hidden=\"true\"></i></li>\n                <li><i class=\"fa fa-circle\" aria-hidden=\"true\"></i></li>\n                <li>&nbsp;</li>\n              </ul>\n            </td>\n            <td class=\"spacing-fa\">\n              <ul>\n                <li>Search results</li>\n                <li>Project details</li>\n                <li>Help wanted</li>\n                <li>Roadmap on site</li>\n                <li>Enhanced compliance dashboard</li>\n                <li>Increased agency participation</li>\n                <li>Metadata schema 1.0 & 1.0.1 deprecation</li>\n              </ul>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n\n    <div class=\"usa-width-one-third\">\n      <table>\n        <thead>\n          <tr>\n            <th scope=\"col\" colspan=\"2\">Medium-term</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <td class=\"fa-graphic-spacing\">\n              <ul>\n                <li>&nbsp;</li>\n                <li>&nbsp;</li>\n                <li><i class=\"fa fa-circle\" aria-hidden=\"true\"></i></li>\n                <li>&nbsp;</li>\n                <li>&nbsp;</li>\n              </ul>\n            </td>\n            <td class=\"spacing-fa\">\n              <ul>\n                <li>Agency pages</li>\n                <li>Medium skin</li>\n                <li>FAQs page</li>\n                <li>Admin tool</li>\n                <li>Enhanced tools & resources</li>\n              </ul>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n\n    <div class=\"usa-width-one-third\">\n      <table>\n        <thead>\n          <tr>\n            <th scope=\"col\" colspan=\"2\">Long-term</th>\n          </tr>\n        </thead>\n        <tbody>\n          <tr>\n            <td class=\"fa-graphic-spacing\">\n              <ul>\n                <li>&nbsp;</li>\n                <li>&nbsp;</li>\n              </ul>\n            </td>\n            <td class=\"spacing-fa\">\n              <ul>\n                <li>User accounts</li>\n                <li>Gamification</li>\n              </ul>\n            </td>\n          </tr>\n        </tbody>\n      </table>\n    </div>\n  </div>\n\n  <div class=\"usa-grid-full\">\n    <p>\n      <i class=\"fa fa-check\" aria-hidden=\"true\"></i>&nbsp; Released\n      <i class=\"fa fa-circle\" aria-hidden=\"true\"></i>&nbsp; In progress\n    </p>\n  </div>\n\n  <div class=\"usa-grid-full roadmap-disclaimer\">\n    <h3>Disclaimer</h3>\n    <p>This Development Roadmap (Roadmap) is for informational purposes only. The Code.gov team will update the Roadmap as frequently as possible but, given that it’s subject to change at any time, the information presented by the Roadmap should not be used for planning purposes. The information presented in the Roadmap does not represent a solicitation or similar contract vehicle. All items in the Roadmap will be developed and released at the sole discretion of Code.gov, the General Services Agency, the Office of Management and Budget, and the United States Federal Government.</p>\n  </div>\n</div>\n";

